Szeląg () is a &lt;a href="human%20settlement"&gt;settlement&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20%C5%81ukta"&gt;Gmina Łukta&lt;/a&gt;, within &lt;a href="Ostr%C3%B3da%20County"&gt;Ostróda County&lt;/a&gt;, &lt;a href="Warmian-Masurian%20Voivodeship"&gt;Warmian-Masurian Voivodeship&lt;/a&gt;, in northern Poland. It lies approximately south-west of &lt;a href="%C5%81ukta"&gt;Łukta&lt;/a&gt;, north of &lt;a href="Ostr%C3%B3da"&gt;Ostróda&lt;/a&gt;, and west of the regional capital &lt;a href="Olsztyn"&gt;Olsztyn&lt;/a&gt;.
